import React from 'react';
import {user} from '../search/user';
import img from './2121.jpg';

function Profile(){
	const nom = user.map( e => e.nom)
	const prenom = user.map( e => e.prenom)
	const telephone = user.map( e => e.telephone)
	const sexe = user.map( e => e.sexe)
	const email = user.map( e => e.email)
	const ville = user.map( e => e.ville)
	const anniversaire = user.map( e => e.anniversaire)

	return(
	<div className='pa2 center bg-light-green br3 ma2 grow  shadow-5' style={{width:'65%', height:'310px'}}> 
		<div className="flex">
		<h1 className="">Mon profil</h1>
		<img src={img} alt="PDP" width="10%" className="img_pers flex justify-end" />
   		</div>
   		<br/>
   		<div>Nom : {nom}</div><br/>
   		<div>Prenom : {prenom}</div>
    	<div> Telephone : +212-{telephone}</div>
    	<div>Sexe : {sexe}</div>
    	<div>Email : {email}</div>
    	<div>Ville : {ville}</div>
    	<div>Date de naissance : {anniversaire}</div>
    </div>

		);
}
  export default Profile;






